import { NextPage } from 'next'
import { Responsive, WidthProvider } from 'react-grid-layout'

const ResponsiveGridLayout = WidthProvider(Responsive)

const EditDashboard: NextPage<{ userAgent: string }> = ({ userAgent }) => {
  const layout = {
    lg: [
      { i: 'a', x: 0, y: 0, w: 1, h: 2 },
      { i: 'b', x: 1, y: 0, w: 3, h: 2 },
      { i: 'c', x: 4, y: 0, w: 1, h: 2 }
    ]
  }

  return (
    <ResponsiveGridLayout className="layout" layouts={layout}
      breakpoints={{ lg: 1200, md: 996, sm: 768, xs: 480, xxs: 0 }}
      cols={{ lg: 12, md: 10, sm: 6, xs: 4, xxs: 2 }}>
      <div key="1" style={{backgroundColor: "#00F"}}>1</div>
      <div key="2" style={{backgroundColor: "#0F0"}}>2</div>
      <div key="3" style={{backgroundColor: "#F00"}}>3</div>
    </ResponsiveGridLayout>
  )
};

export default EditDashboard;
